import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";

const IndiaCluster = () => {
    const [myIndiaData, setIndiaClusterData] = useState([])
    const [myLabels, setmyLabels] = useState([])
    const [myDocument, setmyDocument] = useState([])

    useEffect(() => {
        axios.get('./india/india-cluster.json')
          .then((res) => {
            setIndiaClusterData(res.data)
            setmyLabels(res.data.label_counts)
            setmyDocument(res.data.clusters.documents.title[0])
          }
        )
    }, [])

    console.log(myDocument)

    return (
        <>
            <div className="cluster">
            </div>
        </>
    )
}

export default IndiaCluster

